import React from 'react';
import { Routes, Route } from 'react-router-dom';

import Search from './Search';
import Header from './Header'

const Main = () => {
  return (
    <Routes>
      <Route path='/header' element={Header}></Route>
      <Route exact path='/search' element={Search}></Route>
    </Routes>
  );
}

export default Main;
